<?php

namespace App\Helpers;

use App\Models\ContentManagement;

if(!function_exists('default_pictures'))
{
    function default_pictures(){
        $logos = array([
            "cictLogo"=> 'data:image/png;base64,',
            "sideNav"=> 'data:image/png;base64,'
        ]);
        foreach($logos as $item){
            $content = new ContentManagement;
            $content->cictLogo = $item['cictLogo'];
            $content->sideNav = $item['sideNav'];
            $content->save();
        }
    }
}
